```python
class Solution:
    def numSub(self, nums):
        if not nums or len(nums) == 0:
            return 0

        # use a dictionary to store the frequency of each number
        count = {}
        for num in nums:
            if num in count:
                count[num] += 1
            else:
                count[num] = 1

        result = []

        # traverse the numbers from high to low and add them to the result
        # if they are not already present in the result
        for i in range(len(nums)-1, -1, -1):
            num = nums[i]

            if num in count:
                if num > 0:
                    count[num] -= 1
                elif num < 0:
                    count[-num] += 1

                if count[num] == 0:
                    del count[num]

                if num in result:
                    continue

                result.append(num)

        return len(result)
```
